import styled from 'styled-components';

const Form = styled.form`
  .form-content {
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-column-gap: 8rem;
    max-width: 120rem;
    margin-bottom: 3.2rem;
  }
`;

export default Form;
